import React from "react";

import Form from "react-bootstrap/Form";

const EditInvoice = (props) => {
  return (
    <ul>
      <li>
        <Form.Control
          placeholder="title"
          name="item"
          value={props.item}
          onChange={props.handleInputChange}
        />

        <Form.Control
          placeholder="note"
          type="text"
          name="han"
          value={props.han}
          onChange={props.handleInputChange}
          as="textarea"
          rows={2}
        />
        <button onClick={props.updateinvoice} className="btn btn-success mt-2">
          {" "}
          Update{" "}
        </button>
        <button
          onClick={() => props.setEditing(false)}
          className="btn btn-info mt-2"
        >
          Cancel
        </button>
      </li>
    </ul>
  );
};

export default EditInvoice;
